import React from 'react';
import './Post.css';

class Post extends React.Component {
  constructor(props) {
    super(props);
  }

  componentWillUnmount() {
    //...
  }

  render() {
    return (
      <article>
        <h2 >{this.props.title}</h2>
        <p>{this.props.excerpt}</p>
        <div>
            <div onClick={() => this.props.fnBorrar(this.props.keyy)} >Delete</div>
            <div onClick={() => this.props.fnEdit(this.props.title, this.props.excerpt)} >Edit</div>
        </div>

      </article>
    )
  }
}

export default Post;
